import React from "react";
import "./ListCard.css"

function ListCard(props){
    const mainStyle = {
        display : "flex",
        justifyContent : "space-between",
        backgroundColor :'white',
        borderRadius : "5px"
    };
    return(
        <div style={mainStyle}>
            <div>this</div>
            <div>this</div>
            <div>this</div>
            <div>this</div>
        </div>
    )
}

export default ListCard
